import React from "react";
import styles from "./Home.module.css";

function Home() {
  return (
    <article className={styles.home}>
      <div className={styles.content}>
        <div className={styles.textContent}>
          <h1 className={styles.title}>Breathe Safety Index</h1>
          <p className={styles.description}>
            Оценка влияния качества наружного воздуха на здоровье и благополучие
            человека
          </p>
        </div>
        <div className={styles.imageWrapper}>
          <div className={styles.redSquare}></div>
          <img src="./smoke.png" alt="Люди в масках" className={styles.image} />
        </div>
      </div>
    </article>
  );
}

export default Home;
